import React, {Component} from 'react'
import ReactDOM from 'react-dom'
import './React.css'
import FilteredList from './FilteredList.js'

import Apple from './assets/Apple.png';
import Cherry from './assets/Cherry.png';
import Coconut from './assets/Coconut.png';
import Orange from './assets/Orange.png';
import Peach from './assets/Peach.png';
import Pear from './assets/Pear.png';
import {Paper, Card} from '@material-ui/core'
import 'bootstrap/dist/css/bootstrap.min.css'

const productList = [
 { name: "Cute Plant", size: "Medium", mood: "Happy", price: "$1.99", image:Apple},
 { name: "Happy Plant", size: "Large", mood: "Happy", price: "$1.99", image:Cherry},
 { name: "Sad Plant", size: "Desktop", mood: "Sad", price: "$2.99", image:Coconut},
 { name: "Smart Plant", size: "Medium", mood: "Sad", price: "$6.99", image:Orange},
 { name: "Sleepy Plant", size: "Desktop", mood: "Angry", price: "$3.99", image:Peach},
 { name: "Weird Plant", size: "Large", mood: "Sad", price: "$1.99", image:Pear},
 { name: "Quiet Plant", size: "Large", mood: "Happy", price: "$2.99", image:Apple},
 { name: "All Plant", size: "Large", mood: "Angry", price: "$4.99", image:Cherry},
 { name: "City Plant", size: "Desktop", mood: "Happy", price: "$2.99", image:Coconut},
 { name: "Sweet Plant", size: "Desktop", mood: "Angry", price: "$5.99", image:Orange},
 { name: "Silly Plant", size: "Large", mood: "Angry", price: "$3.99", image:Peach},
 { name: "Spicy Plant", size: "Large", mood: "Happy", price: "$1.99", image:Pear},
 { name: "Vivacious Plant", size: "Desktop", mood: "Sad", price: "$2.99", image:Apple},
 { name: "Chonky Plant", size: "Medium", mood: "Happy", price: "$2.99", image:Cherry},
 { name: "Fancy Plant", size: "Large", mood: "Angry", price: "$9.99", image:Coconut}
]

class App extends Component {
  render() {
    return(
      <div>
      <h1>Title</h1>

        <FilteredList list={productList}/>

      </div>
    )
  }
}

ReactDOM.render(<App />, document.getElementById("root"))
